import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

// ðŸ“‚ Public pages
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import AdminLogin from './pages/AdminLogin';
import AdminRegister from './pages/AdminRegister';
import Unauthorized from './pages/Unauthorized';

// ðŸ‘¤ User pages
import UserDashboard from './pages/UserDashboard';
import BookingPage from './pages/BookingPage';
import ProvidersList from './pages/ProvidersList';
import MyBookings from './pages/MyBookings';

// ðŸ§° Provider pages
import ProviderDashboard from './pages/ProviderDashboard';
import EditProviderProfile from './components/EditProviderProfile';
import ProviderBookingHistory from './pages/ProviderBookingHistory';
import ProviderUpsert from './pages/ProviderUpsert';

// ðŸ‘‘ Admin pages
import AdminDashboard from './pages/AdminDashboard';
// import AdminUsers from './pages/AdminUsers';
import AdminUsers from './components/AdminUsers';
import AdminProviders from './components/AdminProviders';
import AdminBookings from './components/AdminBookings';
import ManageUsers from './pages/admin/ManageUser';

// ðŸ”’ Route guards
import PrivateRoute from './components/PrivateRoute';
import PrivateRouteAdmin from './components/PrivateRouteAdmin';
import MyProviderProfile from './pages/MyProviderProfile';

function App() {
    return ( <
        Router >
        <
        Routes > { /* Public Routes */ } <
        Route path = "/"
        element = { < Navigate to = "/login" / > }
        /> <
        Route path = "/login"
        element = { < LoginPage / > }
        /> <
        Route path = "/register"
        element = { < RegisterPage / > }
        /> <
        Route path = "/admin/login"
        element = { < AdminLogin / > }
        /> <
        Route path = "/admin/register"
        element = { < AdminRegister / > }
        /> <
        Route path = "/unauthorized"
        element = { < Unauthorized / > }
        />

        { /* User Routes */ } <
        Route path = "/user/dashboard"
        element = { <
            PrivateRoute allowedRoles = {
                ['user'] } >
            <
            UserDashboard / >
            <
            /PrivateRoute>
        }
        /> <
        Route path = "/user/bookings"
        element = { <
            PrivateRoute allowedRoles = {
                ['user'] } >
            <
            MyBookings / >
            <
            /PrivateRoute>
        }
        /> <
        Route path = "/book/:providerId"
        element = { <
            PrivateRoute allowedRoles = {
                ['user'] } >
            <
            BookingPage / >
            <
            /PrivateRoute>
        }
        /> <
        Route path = "/providers/:serviceName"
        element = { < ProvidersList / > }
        />

        { /* Provider Routes */ } <
        Route path = "/provider/dashboard"
        element = { <
            PrivateRoute allowedRoles = {
                ['provider'] } >
            <
            ProviderDashboard / >
            <
            /PrivateRoute>
        }
        /> <
